import React from 'react';

const Footer = () => {
  return (
    <>
      <footer className="footer-main  fixed-bottom">
        <div className="container">
          <div className="row address-main">
            <div className="col-lg-4 col-sm-12 col-xs-12">
              <div className="address-box clearfix">
                <div className="add-icon">
                  <img src="Img/footer-icon-01.png" alt="" />
                </div>
                
              </div>
            </div>
          </div>
        </div>

        {/* Copyright Footer */}
        <footer className="bg-dark text-center text-white">
          {/* Grid container */}
          
          {/* Grid container */}

          {/* Copyright */}
          <div
            className="text-center p-3"
            style={{ backgroundColor: 'rgba(0, 0, 0, 0.6)', color: '#fff' }}
          >
            Created By Amit Kumar
            <br />
            Email: amitkumar823906@gmail.com
            <br />
            Portfolio: <a href="https://www.crio.do/learn/portfolio/amitkumar823906/" style={{ color: '#fff' }}>https://www.crio.do/learn/portfolio/amitkumar823906/</a>
            <br />
            LinkedIn: <a href="https://www.linkedin.com/in/amit-kumar-522180201/" style={{ color: '#fff' }}>https://www.linkedin.com/in/amit-kumar-522180201/</a>
            <br />
            GitHub: <a href="https://github.com/Amitbabu123" style={{ color: '#fff' }}>https://github.com/Amitbabu123</a>
          </div>
          {/* Copyright */}
        </footer>
      </footer>
    </>
  );
};

export default Footer;
